-- ----------------------------
-- Table structure for sys_updownfile
-- ----------------------------
DROP TABLE IF EXISTS `sys_updownfile`;
CREATE TABLE `sys_updownfile` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `file_content` varchar(100) DEFAULT NULL COMMENT '文件说明',
  `file_size` bigint(20) DEFAULT NULL COMMENT '文件大小',
  `file_type` varchar(20) DEFAULT NULL COMMENT '文件类型',
  `loginfo` varchar(64) DEFAULT NULL COMMENT '日志',
  `nname` varchar(300) DEFAULT NULL COMMENT '新名字',
  `oname` varchar(50) DEFAULT NULL COMMENT '旧名字',
  `sid` varchar(50) DEFAULT NULL COMMENT '文件所属子系统字典id或表名',
  `uploadpath` varchar(500) DEFAULT NULL COMMENT '保存路径',
  `yn` char(1) DEFAULT '0' COMMENT '上传成功1或失败0，失败可查看日志,默认失败',
  `tableid` varchar(64) DEFAULT NULL COMMENT '文件所属对象id',
  `tablename` varchar(64) DEFAULT NULL COMMENT '文件所属表名称',
  `create_by` varchar(64) DEFAULT NULL COMMENT '创建者',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT NULL COMMENT '更新者',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注信息',
  `del_flag` char(1) DEFAULT '0' COMMENT '删除标记 ''0''未删除''1''删除',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=512 DEFAULT CHARSET=utf8 COMMENT='系统附件';

