-- ----------------------------
-- Table structure for sys_user
-- ----------------------------
DROP TABLE IF EXISTS `sys_user`;
CREATE TABLE `sys_user` (
  `id` varchar(64) NOT NULL COMMENT '编号',
  `office_id` varchar(64) DEFAULT NULL COMMENT '直属部门',
  `login_name` varchar(100) NOT NULL COMMENT '登录名',
  `password` varchar(255) DEFAULT NULL COMMENT '密码',
  `user_name` varchar(100) NOT NULL COMMENT '姓名',
  `sex` char(1) DEFAULT NULL COMMENT '1男0女',
  `if_admin` char(1) DEFAULT NULL COMMENT '是否管理员（0否，1是）',
  `email` varchar(200) DEFAULT NULL COMMENT '邮箱',
  `mobile` varchar(200) DEFAULT NULL COMMENT '手机',
  `user_duty` int(11) DEFAULT NULL COMMENT '用户职务',
  `duty_name` varchar(100) DEFAULT NULL COMMENT '职务名称',
  `accredit_flag` char(1) DEFAULT NULL COMMENT '是否可授权(0否，1是）',
  `sync_flag` char(1) DEFAULT '0' COMMENT '同步标识（0新增1删除2修改3不变）',
  `birthday` date DEFAULT NULL COMMENT '生日',
  `user_code` varchar(100) DEFAULT NULL COMMENT '工号',
  `create_by` varchar(64) DEFAULT NULL COMMENT '创建者',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT NULL COMMENT '更新者',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注信息',
  `del_flag` char(1) DEFAULT '0' COMMENT '删除标记',
  PRIMARY KEY (`id`),
  KEY `sys_user_office_id` (`office_id`) USING BTREE,
  KEY `sys_user_login_name` (`login_name`) USING BTREE,
  KEY `sys_user_update_date` (`update_date`) USING BTREE,
  KEY `sys_user_del_flag` (`del_flag`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户表';

-- ----------------------------
-- Records of sys_user
-- ----------------------------

